float soma(int *e, int j, float* sinapses) {
    float resultado = 0;
    resultado = resultado + sinapses[0] * VLR_BIAS;
    int i;
    for (i = 0; i < WIDTH; i++) {
        resultado = resultado + sinapses[i + 1] * e[j*WIDTH + i];
    }
    return resultado;
}

int degrau(float s) {
    if(s > 127) return 1;
    return 0;
}

float regraDelta(int erro, unsigned char entrada, float sinapse) {
    // printf("erro: %d - Entrada: %d - SAIDA: %f\n", erro, entrada, (sinapse + (TX_APR * erro * entrada)));
    return (sinapse + (TX_APR * erro * entrada));
}

void treinarRede(float * sinapses) {
    int i, j, k, l, resposta, erro;
    // NUMERO DE EPOCAS

    int nr_acertos = 0;
    int total = 0;

    int nr_carros = 0;
    for(i = 0; i < EPOCAS; i++){
        // CONJUNTO DE TREINAMENTOS
        for(j = 0; j < QTD_DADOS_TREINAMENTOS-13; j++){
            for (k = 0; k < HEIGHT; k++) {
				resposta = degrau(soma(dadosTreinamento,j,sinapses));
                //resposta = degrau(soma(dadosTreinamento[j][k], sinapses));
                //erro = dadosTreinamento[j][k][WIDTH] - resposta;
                erro = dadosTreinamento[j*WIDTH+DESIRED_CLASS+1] - resposta;
				//if (dadosTreinamento[j][k][WIDTH]) {
                  //  nr_carros += 1;
                //}
				if (dadosTreinamento[j*WIDTH+DESIRED_CLASS+1]) {
                    nr_carros += 1;
                }
                if(erro){
                    sinapses[0] = regraDelta(erro, VLR_BIAS, sinapses[0]);
                    for (l = 0; l < ENTRADA; l++) {
                        sinapses[l + 1] = regraDelta(erro, dadosTreinamento[j*WIDTH + l], sinapses[l + 1]);
                    }
                } else {
                    nr_acertos += 1;
                }
                total += 1;
            }
        }
        printf("Opa%d\n",i);
    }
    //printf("RESULTADO TREINAMENTO\n");
    //printf("%d acertos, %d total\n", nr_acertos, total);
    //printf("%f %%\n", (100.0 * nr_acertos)/total);

    // printf("%d carros, %d total\n", nr_carros, total);
    // printf("%f %%\n", (100.0 * nr_carros)/total);
    // printf("w[bias] = %f\n", sinapses[0]);
    // for (i = 0; i < ENTRADA; i++) {
    //     printf("w[e%d] = %f\n", i + 1, sinapses[i + 1]);
    // }
}

void testarRede(float * sinapses) {
    int i, j, k, resposta, erro;

    int nr_acertos = 0;
    int t_positivo = 0;
    int t_negativo = 0;
    int f_positivo = 0;
    int f_negativo = 0;
    int total = 0;

    int nr_carros = 0;
    for(i = 0; i < 1; i++){
        // CONJUNTO DE TREINAMENTOS
        for(j = 13; j < QTD_DADOS_TREINAMENTOS; j++){
            for (k = 0; k < HEIGHT; k++) {
                resposta = degrau(soma(dadosTreinamento, j, sinapses));
                // printf("resposta: %d\n", resposta);
                erro = abs(dadosTreinamento[j*WIDTH+DESIRED_CLASS+1] - resposta);

                if (dadosTreinamento[j*WIDTH+DESIRED_CLASS+1] && resposta) {
                    nr_carros += 1;
            	    t_positivo += 1;
                }

                if(!erro) {
                    nr_acertos += 1;
                }

        /*As partes utilizadas para a formao da matriz de confuso no so realmente necessrios para a
        realizao da classificao, apenas para entender como o treinamento da rede est ocorrendo. Essa parte
        pode ser agilizada retirando-se os if's desnecessrios*/
        if(dadosTreinamento[j*WIDTH+DESIRED_CLASS+1] && !resposta)
            f_negativo += 1;
        if(!dadosTreinamento[j*WIDTH+DESIRED_CLASS+1] && !resposta)
            t_negativo += 1;
        if(!dadosTreinamento[j*WIDTH+DESIRED_CLASS+1] && resposta)
            f_positivo += 1;

                total += 1;
            }
        }
    }
    /*Nem todos os prints so necessrios*/
    printf("RESULTADO TESTE\n");
    printf("%d acertos, %d total\n", nr_acertos, total);
    printf("%f %%\n", (100.0 * nr_acertos)/total);
    printf("\n\nMATRIZ DE CONFUSO\nPositivo = %d   Falso positivo = %d\nNegativo = %d   Falso Negativo = %d\n\n", t_positivo, f_positivo, t_negativo, f_negativo);

    // printf("%d carros, %d total\n", nr_carros, total);
    printf("%f %%\n", (100.0 * nr_carros)/total);
    // printf("w[bias] = %f\n", sinapses[0]);
    // for (i = 0; i < ENTRADA; i++) {
    //     printf("w[e%d] = %f\n", i + 1, sinapses[i + 1]);
    // }
}
